static inline float sigmoid(const float x)
{
    return 1.f / (1.f + expf(-x));
}

float processModel()
{
    processScanArea(twin);
    float o1[8] = {0.f,0.f,0.f,0.f,0.f,0.f,0.f,0.f};
    int j = 0, ji = 0;
    for(int i = 0; i < 6280; i++)
    {        
        if(ji > 784)
        {
            o1[j] += aim_model_layer0[i]; // bias
            o1[j] = tanhf(o1[j]);
            j++;
            ji = 0;
        }
        else
        {
            o1[j] += input[ji] * aim_model_layer0[i]; // weight
            ji++;
        }
    }

    float o2 = 0.f;
    for(int i = 0; i < 8; i++)
        o2 += o1[i] * aim_model_layer1[i]; // weight
    o2 += aim_model_layer1[8]; // bias

    return sigmoid(o2);
}

